import { useState } from 'react';
import './App.css';

function App() {
  const [textToggle, textToggleState] = useState(true)
  return (
    <div className="App">
      <button onClick={ () => textToggleState(!textToggle) }>Click me</button>
      <div class="Form">

       <form>
        <p><strong>Upload Image of leaf:              </strong>
       <input type="file" name="imagefile" id="img1" /></p>
        <p><strong>Select Plant:                      </strong>

        <select name="plant" id="p">
          <option value="">Tomato</option>
          <option value="">Papper Bell </option>
          <option value="">Potato</option>
        </select></p>
        <p><input type="submit" value="Submit" /></p>

        <p><input type="reset" value="Reset" /></p>
       </form>

      </div>
    </div>
  );
}

export default App;
